import React, { Component } from "react";
import ReactDOM from 'react-dom';
import PropTypes from "prop-types";


const styleCss = {
    color: "white",
    margin: "0px 250px",
    display: "flex",
    flexDirection: "column",
    fontFamily: "monospace",
}

const Side = {
    color: "white",
    fontFamily: "monospace",
}

const Side1 = {
    listStyle: 'none',
    display: 'flex',
    lineHeight: '100px',
}

const listitem = {
    color: 'white',
    padding: '0px 15px',
    fontFamily: 'monospace',
    textDecoration: 'none',
    fontSize: '25px',
    fontWeight: 'bold',
}

const header = {
    margin: '10px 15px',
    display: 'flex',
    justifyContent: 'space-around',
}

class Profile extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() {
        return (
            <div>
                <div style={header}>
                <div style={Side}>
                    <h1>{this.props.name}</h1>
                    <h1>{this.props.profession}</h1>
                </div>
                <div>
                    <ul style={Side1}>
                    <li style={listitem}><a href="home.html" style={listitem}>{this.props.Home}</a></li>
                    <li style={listitem}><a href="products.html" style={listitem}>{this.props.Products}</a></li>
                    <li style={listitem}><a href="about.html" style={listitem}>{this.props.About}</a></li>
                    <li style={listitem}><a href="contacts.html" style={listitem}>{this.props.Contacts}</a></li>
                </ul>
                </div>
                </div>
                <div style={styleCss}>
                <table cellspacing="20px">
                    <tr>
                        <th>
                            <h1>{this.props.children}</h1>
                        </th>
                        <td>
                            <h2>{this.props.myresume}</h2>
                            <h2>{this.props.mywork}</h2>
                            <h2>{this.props.bio}</h2>
                            <p>{this.props.paragraph}</p>
                        </td>
                    </tr>
                </table>
                </div>
            </div>
        );
    }
}


export default Profile;
